<!DOCTYPE html>
<html>
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1, maximum-scale=1">
    <meta name="mobile-web-app-capable" content="yes">
    <meta name="apple-mobile-web-app-capable" content="yes">
    <meta name="theme-color" content="#000000" />
    <meta name="apple-mobile-web-app-status-bar-style" content="#000000">
    <meta name="apple-mobile-web-app-title" content="Dataset">
    <style>
        :root {
            --white-color: <%= STYLE.WHITE_COLOR %>;
            --main-color: <%= STYLE.MAIN_COLOR %>;
            --green-color: <%= STYLE.GREEN_COLOR %>;
            --contrast-color: <%= STYLE.CONTRAST_COLOR %>;
            --accent-color: <%= STYLE.ACCENT_COLOR %>;
            --soft-gray-color: <%= STYLE.SOFT_GRAY_COLOR %>;
            --text-color: <%= STYLE.TEXT_COLOR %>;
            --text-bg-color: <%= STYLE.TEXT_BG_COLOR %>;
            --font-family: <%= STYLE.FONT_FAMILY %>;
            --home-header-height: <%= STYLE.HOME_HEADER_HEIGHT|toPixels %>;
            --home-footer-height: <%= STYLE.HOME_FOOTER_HEIGHT|toPixels %>;
        }
        body {
            margin: 0;
            padding: 0;
            background-color: #003459;
        }

        #loader.loading {
            width: 100%;
            height: 3px;
            background: #ffffff;
            position: fixed;
            bottom: 0;
            z-index: 99;
        }

        #loader.loading div {
            position: absolute;
            width: 33%;
            height: 100%;
            background: var(--accent-color);
            animation: loading 1s infinite;
        }

        #start-logo {
            width: 150px;
            height: 150px;
            background-size: contain;
            opacity: 0.04;
            position: relative;
            margin: 0 auto;
            top: 135px;
            display: none;
        }

        @keyframes loading {
            0% {
                left: 0
            }
            100% {
                left: 100%
            }
        }

    </style>
</head>
